import React from "react";
import Head from "next/head";
import Header from "./header";
import { Container } from "semantic-ui-react";

export default props => {
  return (
    <div>
      <Container>
        <Head>
          <link
            rel="stylesheet"
            href="//cdn.jsdelivr.net/npm/semantic-ui@2.4.2/dist/semantic.min.css"
          />
        </Head>
        <Header />
        {props.children}
      </Container>
    </div>
  );
};
